	add("nonperson", "{\"term\":\"nonperson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|non|person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Not a real person; a subhuman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Michael C. Kearl, \u0027Endings: A Sociology of Death and Dying\u0027, page 14\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As all lives must end, do you prefer to die as a \u0027\u0027nonperson\u0027\u0027, forgotten in a nursing home and totally stripped of dignity and independence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Lisa J. McIntyre, \u0027Law in the Sociological Enterprise\u0027, page 9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Arguably, what is so hateful about a hate crime is that it is an attempt by some individual or group to treat a Person as a \u0027\u0027Nonperson\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, John E. Tropman, \u0027Does America Hate the Poor?\u0027, page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"How does hate work? [...] One answer is that the poor person (or the Jew, or the Asian, or the Native American, or whoever) becomes, intellectually, linguistically, and emotionally, a \u0026quot;lessperson,\u0026quot; and then a \u0027\u0027nonperson\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Not a legal entity\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something other than a person; an object\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Roger K. R. Thompson, \u0027Natural and Relational Concepts in Animals\u0027, in \u0027Comparative Approaches to Cognitive Science\u0027, page 17\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Taken together, all the results suggested that discrimination of person from \u0027\u0027nonperson\u0027\u0027 slides was not controlled by an obvious single stimulus feature\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Eric T. Olson, \u0027A Compound of Two Substances\u0027, in \u0027Soul, Body, and Survival\u0027, page 7\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"No \u0027\u0027nonperson\u0027\u0027 is psychologically indistinguishable from you\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Ritva Laury, \u0027Interaction, grounding, and third-person referential forms\u0027, in \u0027Grounding: The Epistemic Footing of Deixis and Reference\u0027 (Frank Brisard, ed.), page 8\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"For example, Benveniste [...] discusses the connection of first- and second-person pronouns with the speech situation, and even goes as far as to claim that the third person is a \u0027\u0027nonperson\u0027\u0027, since the referents of third-person pronouns are not speech-act participants\", \"priority\":15}]}, \"synonyms\":{}}");

